  input: TEXT,F3N,,"Pursuant to our requirements under law, and following our conversation
    last Wednesday, I am outlining our efforts to obtain missing information from
    contributors.  The candidate, Bill Manger, first considered running for Congress
    in 2000, and an exploratory committee was formed. Mr. Manger never declared a
    candidacy in 2000, and the campaign was moribund while he considered whether he
    would run eventually, or return any contributions.  On December 12, 2003 Mr. Manger
    did declare his candidacy.  Accordingly, we are now submitting our first report
    containing all the activity of both the exploratory committee as well as the current
    'Bill Manger for Congress Committee' (C00393983).  As we have discussed, in some
    cases contributors did not furnish us with the required personal information.  Both
    the Exploratory Committee and the Campaign have made extensive efforts, first
    by mail, and then with follow-up phone calls, to reach any contributor for whom
    we do not have sufficient information, and to then obtain it.  These efforts will
    continue, and future reports will contain updated information as necessary.  Since
    Mr. Manger's declaration we have not held any further fundraisers, but will resume
    doing so in the current quarter.  I am at (212) 344-1500 ext. 210, or (212) 873-4069,
    should you need to reach me.  Sincerely, John Philip"
